import React, { useState, useEffect, useContext } from 'react';
import config from './config';
import DrinkCard from './DrinkCard';
import CustomizeOrderComponent from './CustomizeOrderComponent';
import ProductCategory from './ProductCategory';


import { CartContext } from './CartContext';

function EmployeeView() {

    return (
        <div className='fixed w-full h-full'>
            <div className='flex h-full'>
                <div id="Order" className='h-full w-1/3 border-r'>
                    <div id="OrderList">Order List</div>
                    <div id="OrderPrice">Order Price</div>
                </div>
                <div id="Product" className='w-full flex flex-col'>
                    <div id="ProductCategory" className='flex-1 overflow-y-auto h-1/2'>
                        <ProductCategory/>
                    </div>
                    <div id="ProductCustomization" className="sticky bottom-0 h-1/3 p-4 bg-white m-4 border-t flex">
                        <CustomizeOrderComponent/>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default EmployeeView;
